let initialState = { 
	img:['https://www.sticky.digital/wp-content/uploads/2013/11/img-6.jpg',
	'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTxYemmTO9egxdCwvuKQpKd03kZvLfE8b2fWGpzNYZ3RthVT_QvV5VxW0bFYoGZRVn5P6euePMxlI63xIImweC0BiSTVGJVLu27pA&usqp=CAU&ec=45695924',
	'https://www.imgonline.com.ua/examples/red-yellow-flower.jpg',
	'https://www.sticky.digital/wp-content/uploads/2013/11/img-6.jpg',
	'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTxYemmTO9egxdCwvuKQpKd03kZvLfE8b2fWGpzNYZ3RthVT_QvV5VxW0bFYoGZRVn5P6euePMxlI63xIImweC0BiSTVGJVLu27pA&usqp=CAU&ec=45695924',
	'https://www.imgonline.com.ua/examples/red-yellow-flower.jpg']
}

const NavReducer = (state = initialState , action) => {

	switch(action.type){
		case 'NEW-STYLE' :
		return{
			...state,	
			style : 'auto'
		}

		default:
			return state;	
	} 	
}

export const NewStyle = () => {
	return {
		type:'NEW-STYLE'
	}
}



export default NavReducer;
